function OcjectTest() {
    let obj = {
        name : "test",

        getName : function() {
            return this.name
        },
        setName : function(name) {
            this.name = name
        },
        display : function() {
            console.log(this.name)
        }
    }

    console.log(obj.getName())

    obj.setName("gogosing")
    console.log(obj.getName)

    obj.display()
    console.log(obj["getName"]())

    obj["setName"]("Star Ocean")
    console.log(obj["getName"]())

    return (
        <div className = "ObjectTest">
            <p>
                ObjectTest
            </p>
        </div>
    )
}

export default OcjectTest
